import { Container } from "react-bootstrap";

import Todo from './Todo';

const Solution = () => {
    const i=Todo.Solution
  return (
    <Container>
      <h2>Solutions</h2>
      <div>
      {i.map((step) => (
        <div key={i.indexOf(step)}>{step}</div>
      ))}
    </div>
    </Container>
  );
};

export default Solution;
